import React from 'react';

const Buttons = () => {
    return (
        <main className="d-flex flex-column justify-content-center align-items-center vh-100">
            <h1 className="mb-1">¡BIENVENIDOS A MI PAGINA!</h1>
            <div className="text-center">
                <button className="btn btn-outline-primary mb-2">Iniciar Sesión</button>
                <button className="btn btn-outline-primary">Registrarse</button>
            </div>
        </main>

    );
};

export default Buttons;
